class Solution:

    def canConvertString(self, s: str, t: str, k: int) -> bool:
        def getCount(ca, cb):
            if ca == cb:
                return 0
            df = (ord(cb) - ord(ca) + 26) % 26
            cnt = df + lookup[df] * 26
            lookup[df] += 1
            return cnt

        if len(s) != len(t):
            return False
        # //è®°å½•æ¬¡æ•°
        lookup = [0] * 26
        ans = 0
        for i in range(len(s)):
            ans = max(ans, getCount(s[i], t[i]))
        # print(lookup)
        return ans <= k

