class Solution5469:

    def canConvertString(self, s: str, t: str, k: int) -> bool:
        """AC å®Œäº†æ‰åšå‡ºæ¥"""
        if len(s) != len(t):
            return False
        if s == t:
            return True
        N = len(s)
        lookup = {}
        seen = collections.defaultdict(int)
        for idx in range(N):
            cs, ct = s[idx], t[idx]
            if cs == ct:
                continue
            raw_diff = (ord(ct) - ord(cs) + 26) % 26
            if raw_diff in seen:
                diff = seen[raw_diff] + 26
            else:
                diff = raw_diff
            seen[raw_diff] = diff
            lookup[idx] = diff

        values = list(lookup.values())
        if max(values) > k:
            return False
        return len(set(values)) <= k


